import { createChatBotMessage } from "react-chatbot-kit";

const botName = "DermaBot";
const config = {
  initialMessages: [
    createChatBotMessage(
      `Oi, sou a ${botName}.

      Estou aqui para te ajudar escolher um produto. Como descreveria sua pele?`,
      { widget: "skinOptions" }
    ),
  ],
  botName: botName,
  customStyles: {
    botMessageBox: { backgroundColor: "#376B7E" },
    chatButton: { backgroundColor: "#5ccc9d" },
  },
};

export default config;
